import React from 'react'
import Banner from './Banner'
import { connect } from 'react-redux'

const Banners = ({ data }) => {
    return data.map((v, i) => {
        <Banner id={i} />
    })
}

const mapStateToProps = state => {
    return {
        data: state.data.cities
    }
}

export default Banners
